import React, { Component } from 'react';
import './App.css';
import Excel from "./components/Excel";
import Form_new_part from "./components/Form_new_part";
import {Tabs, TabLink, TabContent} from 'react-tabs-redux';
import Parcel from "./components/Parcel";
import Device from "./components/Device";

var invariant = require('invariant');

type Props = {
};

type State = {
    renderFlag : boolean,
};

class App extends Component<Props, State> {

  excel: ?Excel;
  parcel: ?Parcel;
  device: ?Device;
  sprintTasksTotal: any;
  data: any;

  constructor(props: Props, state: State) {
    super(props, state);
    this.httpRequest = this.httpRequest.bind(this);
    this.fetchData = this.fetchData.bind(this);
    this.hideCompletedTasks = this.hideCompletedTasks.bind(this);
    this.state = {isChecked: false};
  }

  componentDidMount() {
      document.title = "Warehouse";
      setInterval(this.fetchData, 3000);
      this.fetchData();
  }
  triggerJson() {
    invariant(this.excel, "excel component is null!");
    this.excel.exportJSON();
  }

  triggerCsv() {
    invariant(this.excel, "excel component is null!");
    this.excel.exportCSV();
  }

  componentWillMount(){
      // console.log("will mount");
      this.fetchData();
  }

  fetchData() {
      var xhr = new XMLHttpRequest();
      xhr.responseType = 'json';
      xhr.onload = () => {
          data = xhr.response;
          this.setState( {
              renderFlag: true
          });
          // console.log("data App: ", data);
          var myJSON = JSON.stringify(data, function(key, value) { return (value == null) ? "" : value });
          // console.log("typeof myJSON: ", typeof myJSON);
          data = JSON.parse(myJSON);
          this.excel.updateData(data);
      };
      xhr.open('GET', '/warehouse', true);
      xhr.send(null);

  }

  httpRequest() {
      var xhr = new XMLHttpRequest();
      xhr.onload = () => {
          data = xhr.response;
          // console.log("dataAppH: ", data);
          this.excel.updateData(data);
      };
      xhr.open('GET', '/warehouse', true);
      xhr.send(null);
  }

  hideCompletedTasks() {
      this.excel.hideCompleted(!this.state.isChecked);
      this.setState({isChecked: !this.state.isChecked});
  }

  render() {
      var txt;
      if(this.state.isChecked) {
          txt = 'hide';
      } else {
          txt = 'show';
      }
    return (
        <Tabs className="tabs tabs-1">
            <TabLink to="tab1">Warehouse</TabLink>
            <TabLink to="tab2">Add HW</TabLink>
            <TabLink to="tab3">Parcel</TabLink>
            <TabLink to="tab4">Device</TabLink>
            <TabContent for="tab1">
                <div>
                    <Excel ref={excel => (this.excel = excel)} columnDataTypes={columnDataTypes} columnClasses={columnClasses} headers={headers} initialData={data} search={true}/>
                </div>
            </TabContent>
            <TabContent for="tab2">
                <h2>
                    <Form_new_part></Form_new_part>
                </h2>
            </TabContent>
            <TabContent for="tab3">
                <div>
                    <Parcel ref={parcel => (this.parcel = parcel)} columnDataTypes={columnDataTypes2} columnClasses={columnClasses2} headers={headers2} initialData={data2} search={true}/>
                </div>
            </TabContent>
            <TabContent for="tab4">
                <div>
                    <Device ref={device => (this.device = device)} columnDataTypes={columnDataTypes3} columnClasses={columnClasses3} headers={headers3} initialData={data3} search={true}/>
                </div>
            </TabContent>
        </Tabs>
        );
  }
}

